58\uB294\uB370\uB3C4 \uAE30\uC5B5\uD558\uC9C0 \uBABB\uD558\uB294 \uAC83\uC778\uAC00? \uBC14\uB85C \uC5CA\uADF8\uC81C \uB098\uC758 \uBBF8\uB798 \uBAA8\uC2B5\uB4E4\uC5D0 \uB300\uD574\uC11C \uC0C1\uC0C1\uD574\uBCF4\uC558\uACE0, \uC88B\uC558\uB294\uB370, \uADF8\uAC83\uC744 \uBA87 \uC77C \uB4A4\uC5D0 \uBC14\uB85C \uC78A\uC5B4\uBA39\uB2E4\uB2C8? \uB9D0 \uADF8\uB300\uB85C \uC791\uC2EC\uC0BC\uC77C\uC778 \uAC83\uC778\uAC00? \uC544\uB2C8\uBA74, \uBAA9\uD45C\uAC00 \uB9C8\uC74C\uC5D0 \uD655 \uC640\uB2FF\uC9C0 \uC54A\uC544\uC11C\uC778\uAC00? \uAC00\uC2B4 \uB6F0\uB294 \uBAA9\uD45C\uAC00 \uC544\uB2C8\uC5C8\uB098? \uC544\uB2C8\uBA74 \uADF8\uAC83\uC744 \uD574\uB0BC \uC790\uC2E0\uAC10\uC744 \uC783\uC5B4\uBC84\uB9B0 \uAC83\uC778\uAC00? \uC544\uB2C8\uB2E4. \uB2E4\uB9CC \uC8FC\uB9D0\uC744 \uC274 \uB3D9\uC548 \uC78A\uACE0 \uC788\uC5C8\uAE30 \uB54C\uBB38\uC77C \uAC83\uC774\uB2E4. \uADF8\uB798. \uADF8\uB7F0\uAC70\uC57C. \uC2E4\uCEF7 \uC8FC\uB9D0\uC744 \uC990\uAE34\uB2E4\uACE0 \uB180\uC558\uC73C\uB2C8, \uC774\uC81C \uB2E4\uC2DC \uBAA9\uD45C\uB97C \uD5A5\uD574 \uCDA9\uC2E4\uD788 \uAC00\uBA74 \uB418\uB294 \uAC70\uACA0\uC9C0. \uB2E4\uC2DC \uD55C\uBC88 \uBAA9\uD45C\uB4E4\uC744 \uC0C1\uAE30\uC2DC\uD0A4\uBA74\uC11C \uC6D4\uAC04 \uACC4\uD68D\uC744 \uC138\uC6B0\uACE0, \uC8FC\uAC04 \uACC4\uD68D\uC744 \uC138\uC6B0\uACE0, \uC77C\uAC04 \uACC4\uD68D\uC744 \uC138\uC6B0\uBA74 \uB41C\uB2E4. \uD070 \uADF8\uB9BC\uC774 \uADF8\uB824\uC9C4 \uB4A4\uC5D0, \uC791\uC740 \uC138\uC138\uD55C \uBD80\uBD84\uC744 \uC870\uAE08 \uB354 \uC9D1\uC911\uC801\uC73C\uB85C \uC138\uC6B0\uBA74 \uB420 \uAC83\uC774\uB2E4. \uAF2D \uC774\uB8E8\uACA0\uB2E4\uB294 \uB9C8\uC74C\uAC00\uC9D0\uC744 \uAC00\uC9C0\uACE0 \uB2E4\uC2DC \uD55C\uBC88 \uC815\uC9C4\uD560 \uC218 \uC788\uB2E4."), mdx("p", null, "\uC815\uC2E0\uC744 \uB611\uBC14\uB85C \uCC28\uB9AC\uACE0, \uC55E\uC73C\uB85C \uB098\uC544\uAC00\uB77C."), mdx("p", {
